#
# The trick here is to maintain a global array of 32 bits to help with the Sliding Window
# implementation. The max number will not have more than 32 bits. Finding out the total OR
# of an array over and over again will be expensive.
#
from typing import List

class Solution:
    def minimumSubarrayLength(self, nums: List[int], k: int) -> int:
        def list_or():
            place_value = 1
            res = 0
            for i in range(31, -1, -1):
                res += place_value if arr[i] > 0 else 0
                place_value *= 2
            return res
        def list_or_add(n):
            s = bin(n)[2:].zfill(32)
            for i in range(31, -1, -1):
                if s[i] == '1':
                    arr[i] += 1
        def list_or_remove(n):
            s = bin(n)[2:].zfill(32)
            for i in range(31, -1, -1):
                if s[i] == '1':
                    arr[i] -= 1
        arr = [0] * 32
        N = len(nums)
        i, j = 0, 0
        res = float('inf')
        while j < N:
            list_or_add(nums[j])
            while i <= j and list_or() >= k:
                res = min(res, j - i + 1)
                list_or_remove(nums[i])
                i += 1
            j += 1
        return -1 if res == float('inf') else res

